import React from "react";
import { useNavigate } from "react-router-dom";
import "../App.css";

function OrganizationPage() {
  const navigate = useNavigate();

  const users = [
    { no: 1, username: "Alice", points: 3000, tournaments: 5 },
    { no: 2, username: "Bob", points: 2700, tournaments: 4 },
    { no: 3, username: "Charlie", points: 2500, tournaments: 3 }
  ];

  const tournaments = [
    { no: 1, time: "10:00 AM", date: "2025-12-05", maxPlayers: 16 },
    { no: 2, time: "2:00 PM", date: "2025-12-07", maxPlayers: 32 },
    { no: 3, time: "6:00 PM", date: "2025-12-10", maxPlayers: 24 }
  ];

  return (
    <div className="page-container">
      <h1 className="page-title">Organization Page</h1>

      {/* Back Button */}
      <button
        onClick={() => navigate("/")}
        className="add-button"
        style={{ marginBottom: "20px" }}
      >
        Back
      </button>

      {/* Users Table */}
      <div className="table-section">
        <button className="add-button">Add User</button>
        <table className="custom-table">
          <thead>
            <tr>
              <th>No</th>
              <th>Username</th>
              <th>Points</th>
              <th>Tournaments Played</th>
            </tr>
          </thead>
          <tbody>
            {users.map((user) => (
              <tr key={user.no}>
                <td>{user.no}</td>
                <td>{user.username}</td>
                <td>{user.points}</td>
                <td>{user.tournaments}</td>
              </tr>
            ))}
          </tbody>
        </table>
      </div>

      {/* Tournaments Table */}
      <div className="table-section">
        <button className="add-button">Add Tournament</button>
        <table className="custom-table">
          <thead>
            <tr>
              <th>No</th>
              <th>Time</th>
              <th>Date</th>
              <th>Max Players</th>
            </tr>
          </thead>
          <tbody>
            {tournaments.map((tournament) => (
              <tr key={tournament.no}>
                <td>{tournament.no}</td>
                <td>{tournament.time}</td>
                <td>{tournament.date}</td>
                <td>{tournament.maxPlayers}</td>
              </tr>
            ))}
          </tbody>
        </table>
      </div>
    </div>
  );
}

export default OrganizationPage;
